import React from "react";
import { Box, Link, Flex } from "@chakra-ui/core";

interface NavBarProps {}

const NavBar: React.FC<NavBarProps> = ({}) => {
  return (
    <Flex bg="tomato" p={4}>
      <Box ml={"auto"}>
        <Link color="white" mr={2}>
          login
        </Link>
        <Link color="white">register</Link>
      </Box>
    </Flex>
  );
};

export default NavBar;
